import React, { Component } from 'react';
import './App.css';
import { ResponsiveBar } from '@nivo/bar';

class App extends Component {
  render() {
    return (
      <ResponsiveBar
        height={500}
        margin={{
          top: 60,
          right: 80,
          bottom: 60,
          left: 80
        }}
        data={[
          {
            country: 'AD',
            hot_dogs: 108,
            hot_dogsColor: 'hsl(352, 70%, 50%)',

          },
          {
            country: 'AE',
            hot_dogs: 121,
            hot_dogsColor: 'hsl(347, 70%, 50%)',

          },
          {
            country: 'AF',
            hot_dogs: 159,
            hot_dogsColor: 'hsl(38, 70%, 50%)',

          },
          {
            country: 'AG',
            hot_dogs: 126,
            hot_dogsColor: 'hsl(330, 70%, 50%)',

          },
          {
            country: 'AI',
            hot_dogs: 53,
            hot_dogsColor: 'hsl(323, 70%, 50%)',

          },
          {
            country: 'AL',
            hot_dogs: 20,
            hot_dogsColor: 'hsl(40, 70%, 50%)',

          },
          {
            country: 'AM',
            hot_dogs: 147,
            hot_dogsColor: 'hsl(352, 70%, 50%)',

          }
        ]}
        indexBy="country"
        keys={[
          'hot_dogs',
          'burgers',
          'sandwich',
          'kebab',
          'fries',
          'donut'
        ]}
        padding={0.2}
        labelTextColor="inherit:darker(1.4)"
        labelSkipWidth={16}
        labelSkipHeight={16}
        groupMode="grouped"
      />
    );
  }
}

export default App;
